かなーり昔の話ですが、京都旅行中に外国人観光客らしき女性にいきなり「I can do❓」と聞かれました。

（あなたが何か出来ようが出来まいが私には関係ないよ…）と思いましたが、ここで自分がつれない態度をとってしまったらお・も・て・な・しJAPANのイメージにキズが付くと勝手に思い込み、満面の笑みで「yeah😆❗️you can do😆‼️」とサムズアップしました。

そしたら女性は（はぁ⁉️）って顔をしながら何度も何度も「I can do❓」と聞いてきました。後ろを指差しながら。

彼女の指した先には【永観堂】と書かれた看板がありました…はい…エイカンドウとアイキャンドゥを聞き間違えていました😭だってその瞬間までエイカンドウの存在を知らなかったんだもん😭たまたま前を通りかかっただけだったんだもん😭てかめっちゃ有名なのねココ😭

すっかり忘れていた出来事でしたが、今回の旅行でふと思い出し、初めて中に入ってみました😊あの女性、元気にしてるかな❓

